import React from 'react';
import siteLogo from './Logo1.JPG';

const HeaderMenuTitle = () => (
    <div className='HeaderTitle'>
        <img src={siteLogo} alt='Taste of Hansung' className='Logo' />
    </div>
)

const HeaderMenu = () => (
    <div className='HeaderBar'>
        <HeaderMenuTitle />
        <span>성신여대입구</span>
        <span>한성대입구</span>
        <span>혜화</span>
    </div>
)

export default HeaderMenu;
